import React from 'react';
import HeaderBlock from './components/HeaderBlock';
import TextBlock from './components/TextBlock';

const App = () => {
  return (
      <>
        <HeaderBlock 
          title="World Travel Guide"
          descr="Live Your Life"/>
        <TextBlock 
          descr = "The World Travel Guide (WTG) is the flagship digital consumer brand within the Columbus Travel Media portfolio. Available in English, German, and Spanish versions, the WTG provides detailed and accurate travel content designed to inspire global travellers. It covers all aspects, from cities to airports, cruise ports to ski and beach resorts, attractions to events, and it also includes offbeat travel news, stories, quizzes and guides for adventurous travellers." />
      </>
  );
}
export default App;
